import "../Styles/nav.css";

function Navbar() {
  return (
    <div className="navHolder">
      <div className="navHolder__logoHolder">
        <img className="navHolder__logo" src="https://via.placeholder.com/60"
          alt="icon" />
        <div className="navHolder__logoTitle">Scratch Paint</div>
      </div>
      <div className="navHolder__buttonHolder">
        <button>HOME</button>
        <button>PAINT</button>
        <button>THE TEAM</button>
      </div>
    </div>
  );
}

export default Navbar;
